---
apiVersion: apps/v1
kind: Deployment
metadata:
  name: trailblazehunt
  namespace: trailblazehunt
spec:
  replicas: 1
  revisionHistoryLimit: 10
  selector:
    matchLabels:
      app: trailblazehunt
      deployment: trailblazehunt
  strategy:
    rollingUpdate:
      maxSurge: 25%
      maxUnavailable: 25%
    type: RollingUpdate
  template:
    metadata:
      creationTimestamp: null
      labels:
        app: trailblazehunt
        deployment: trailblazehunt
    spec:
      containers:
      - env:
        - name: AUTH_REALM
          valueFrom:
            secretKeyRef:
              key: AUTH_REALM
              name: trailblazehunt-secret
        - name: AUTH_RESOURCE
          valueFrom:
            secretKeyRef:
              key: AUTH_RESOURCE
              name: trailblazehunt-secret
        - name: AUTH_SECRET
          valueFrom:
            secretKeyRef:
              key: AUTH_SECRET
              name: trailblazehunt-secret
        - name: AUTH_HOST_NAME
          valueFrom:
            secretKeyRef:
              key: AUTH_HOST_NAME
              name: trailblazehunt-secret
        - name: AUTH_PORT
          valueFrom:
            secretKeyRef:
              key: AUTH_PORT
              name: trailblazehunt-secret
        - name: AUTH_SSL
          valueFrom:
            secretKeyRef:
              key: AUTH_SSL
              name: trailblazehunt-secret
        - name: AUTH_TOKEN_URI
          value: /realms/TRAILBLAZEHUNT/protocol/openid-connect/token
        - name: EMAIL_AUTH
          valueFrom:
            secretKeyRef:
              key: EMAIL_AUTH
              name: trailblazehunt-secret
        - name: EMAIL_FROM
          valueFrom:
            secretKeyRef:
              key: EMAIL_FROM
              name: trailblazehunt-secret
        - name: EMAIL_HOST
          valueFrom:
            secretKeyRef:
              key: EMAIL_HOST
              name: trailblazehunt-secret
        - name: EMAIL_PASSWORD
          valueFrom:
            secretKeyRef:
              key: EMAIL_PASSWORD
              name: trailblazehunt-secret
        - name: EMAIL_PORT
          valueFrom:
            secretKeyRef:
              key: EMAIL_PORT
              name: trailblazehunt-secret
        - name: EMAIL_SSL
          valueFrom:
            secretKeyRef:
              key: EMAIL_SSL
              name: trailblazehunt-secret
        - name: EMAIL_USERNAME
          valueFrom:
            secretKeyRef:
              key: EMAIL_USERNAME
              name: trailblazehunt-secret
        - name: OPENSHIFT_SERVICE
          value: trailblazehunt
        - name: CLUSTER_PORT
          value: "8081"
        - name: ZOOKEEPER_HOST_NAME
          value: zookeeper.trailblazehunt.svc
        - name: ZOOKEEPER_PORT
          value: "2181"
        - name: SOLR_HOST_NAME
          value: solr-solrcloud-headless.solr.svc
        - name: SOLR_PORT
          value: "8983"
        - name: SOLR_URL
          value: http://solr.solr-solrcloud-headless.svc:8983/solr/trailblazehunt
        - name: SITE_HOST_NAME
          value: www.trailblazehunt.com
        - name: SITE_PORT
          value: "8080"
        - name: SITE_BASE_URL
          value: https://www.trailblazehunt.com
        - name: NUMBER_EXECUTORS
          value: "5"
        - name: STATIC_BASE_URL
          value: https://computate.neocities.org
        - name: SITE_ZONE
          value: America/Denver
        - name: DB_SERVICE_PREFIX_MAPPING
          value: trailblazehunt=DB
        - name: DB_JNDI
          value: jboss/datasources/defaultDS
        - name: DB_USERNAME
          valueFrom:
            secretKeyRef:
              key: JDBC_USERNAME
              name: trailblazehunt-secret
        - name: DB_PASSWORD
          valueFrom:
            secretKeyRef:
              key: JDBC_PASSWORD
              name: trailblazehunt-secret
        - name: DB_DATABASE
          valueFrom:
            secretKeyRef:
              key: JDBC_DATABASE
              name: trailblazehunt-secret
        - name: DB_MIN_POOL_SIZE
        - name: DB_MAX_POOL_SIZE
        - name: DB_TX_ISOLATION
        image: quay.io/computate/trailblazehunt:latest
        imagePullPolicy: Always
        name: trailblazehunt
        ports:
        - containerPort: 8778
          name: jolokia
          protocol: TCP
        - containerPort: 8080
          name: http
          protocol: TCP
        - containerPort: 8443
          name: https
          protocol: TCP
        resources:
          limits:
            memory: '1Gi'
            cpu: '1'
          requests:
            memory: '200Mi'
            cpu: '200m'
        terminationMessagePath: /dev/termination-log
        terminationMessagePolicy: File
        volumeMounts:
        - mountPath: /opt/trailblazehunt.com/config
          name: trailblazehunt-config-secret
          readOnly: true
        - mountPath: /opt/trailblazehunt.com/docroot
          name: volume-static
#        - mountPath: /usr/local/tomcat/lib/keycloak-tomcat-core-adapter-2.4.0.Final.jar
#          name: trailblazehunt-lib-keycloak-tomcat-core-adapter
#          subPath: keycloak-tomcat-core-adapter-2.4.0.Final.jar
#        - mountPath: /usr/local/tomcat/lib/keycloak-tomcat-adapter-spi-2.4.0.Final.jar
#          name: trailblazehunt-lib-keycloak-tomcat-adapter-spi
#          subPath: keycloak-tomcat-adapter-spi-2.4.0.Final.jar
#        - mountPath: /usr/local/tomcat/lib/keycloak-tomcat8-adapter-2.4.0.Final.jar
#          name: trailblazehunt-lib-keycloak-tomcat8-adapter
#          subPath: keycloak-tomcat8-adapter-2.4.0.Final.jar
#        - mountPath: /usr/local/tomcat/lib/keycloak-adapter-spi-2.4.0.Final.jar
#          name: trailblazehunt-lib-keycloak-adapter-spi
#          subPath: keycloak-adapter-spi-2.4.0.Final.jar
#        - mountPath: /usr/local/tomcat/lib/keycloak-common-2.4.0.Final.jar
#          name: trailblazehunt-lib-keycloak-common
#          subPath: keycloak-common-2.4.0.Final.jar
#        - mountPath: /usr/local/tomcat/lib/keycloak-authz-client-2.4.0.Final.jar
#          name: trailblazehunt-lib-keycloak-authz-client
#          subPath: keycloak-authz-client-2.4.0.Final.jar
#        - mountPath: /usr/local/tomcat/lib/keycloak-adapter-core-2.4.0.Final.jar
#          name: trailblazehunt-lib-keycloak-adapter-core
#          subPath: keycloak-adapter-core-2.4.0.Final.jar
#        - mountPath: /usr/local/tomcat/lib/keycloak-core-2.4.0.Final.jar
#          name: trailblazehunt-lib-keycloak-core
#          subPath: keycloak-core-2.4.0.Final.jar
        - mountPath: /deployments/manager/META-INF
          name: trailblaze-manager-context
          readOnly: true
        - mountPath: /usr/local/tomcat/conf/tomcat-users.xml
          name: trailblaze-tomcat-users
          readOnly: true
          subPath: tomcat-users.xml
      dnsPolicy: ClusterFirst
      restartPolicy: Always
      schedulerName: default-scheduler
      securityContext: {}
      terminationGracePeriodSeconds: 30
      volumes:
      - name: trailblazehunt-config-secret
        secret:
          defaultMode: 420
          secretName: trailblazehunt-config-secret
      - name: volume-static
        persistentVolumeClaim:
          claimName: trailblazehunt-persistent-volume-claim-static
      - configMap:
          defaultMode: 420
          name: trailblazehunt-lib-keycloak-tomcat-core-adapter
        name: trailblazehunt-lib-keycloak-tomcat-core-adapter
      - configMap:
          defaultMode: 420
          name: trailblazehunt-lib-keycloak-tomcat-adapter-spi
        name: trailblazehunt-lib-keycloak-tomcat-adapter-spi
      - configMap:
          defaultMode: 420
          name: trailblazehunt-lib-keycloak-tomcat8-adapter
        name: trailblazehunt-lib-keycloak-tomcat8-adapter
      - configMap:
          defaultMode: 420
          name: trailblazehunt-lib-keycloak-adapter-spi
        name: trailblazehunt-lib-keycloak-adapter-spi
      - configMap:
          defaultMode: 420
          name: trailblazehunt-lib-keycloak-common
        name: trailblazehunt-lib-keycloak-common
      - configMap:
          defaultMode: 420
          name: trailblazehunt-lib-keycloak-authz-client
        name: trailblazehunt-lib-keycloak-authz-client
      - configMap:
          defaultMode: 420
          name: trailblazehunt-lib-keycloak-adapter-core
        name: trailblazehunt-lib-keycloak-adapter-core
      - configMap:
          defaultMode: 420
          name: trailblazehunt-lib-keycloak-core
        name: trailblazehunt-lib-keycloak-core
      - name: trailblaze-manager-context
        secret:
          defaultMode: 420
          secretName: trailblaze-manager-context
      - name: trailblaze-tomcat-users
        secret:
          defaultMode: 420
          secretName: trailblaze-tomcat-users
  test: false
  triggers:
  - imageChangeParams:
      automatic: true
      containerNames:
      - trailblazehunt
      from:
        kind: ImageStreamTag
        name: trailblazehunt:latest
        namespace: trailblazehunt
      lastTriggeredImage: docker-registry.default.svc:5000/trailblazehunt/trailblazehunt@sha256:62247777597d3fdbd5faf60285a06270af3b78c6173efdc23f0b76679089fc82
    type: ImageChange
  - type: ConfigChange
---
apiVersion: v1
kind: Service
metadata:
  name: trailblazehunt
  namespace: trailblazehunt
spec:
  ports:
  - name: http
    port: 8080
    protocol: TCP
    targetPort: 8080
  - name: https
    port: 8443
    protocol: TCP
    targetPort: 8443
  selector:
    app: trailblazehunt
  sessionAffinity: None
  type: ClusterIP
---
